import React,{Component} from 'react';
import { Badge } from "antd";
import { LikeOutlined,CommentOutlined,ShareAltOutlined  } from "@ant-design/icons";
import Input from '../Common/Input';
class CardComment extends Component{
    render(){
        const { auth, comments, classes } = this.props;
        return(
            <div className="card-comment">   
                <div className="comment-input">
                    <div className="comment-header-img">
                        <img src="/static/images/profile.jpeg"  className="profile-header-post-pic"/>
                    </div>
                    <div className="comment-input-container">
                        <Input placeholder="Write Review *" name="comment" type="text" inputCss="post-comment"   />
                    </div>
                </div>
                <div className="comment-list">
                    <div className="comment-header-img">
                        <img src="/static/images/profile.jpeg"  className="profile-header-post-pic"/>
                    </div>
                    <div className="comment-list-container">
                        <span className="commentor-name">Sikandar</span>
                        <span classsName="comment-time">  3 hours ago</span>
                        <p>Nice Pic</p>
                    </div>
                </div>
            </div>
        )
    }
}

export default CardComment;
